(341, 0, 2, 1, 'Newton &quot;corrected&quot; this law by squaring both sides of one form of it, and this law is used to compute the Gaussian gravitational constant. Joseph Privat de Molieres proved one case of it by showing that if the normal force and centripetal force are proportional, then one over r squared is proportional to v squared over r, and since v is proportional to r over t, r cubed is proportional to t squared. Name this law. ', '', '', '', '', 'Kepler&#039;s Third Law ', 0, 3, 0, '2013-11-26 02:55:40', 0),
