(343, 0, 2, 1, 'The Kutta-Joukowski theorem is derived from this result, and Ludwig Prandtl used Euler&#039;s equation to expand it to non-ideal states. Pitot tubes measure velocity and are based on this result, and the Venturi Effect is essentially an expression of this law for an incompressible fluid bottlenecked in a pipe. This principle is? ', '', '', '', '', 'Bernoulli&#039;s Principle  ', 0, 3, 0, '2013-11-26 02:55:40', 0),
(344, 1, 2, 1, 'In this man&#039;s namesake effect, a magnetic field rotates the plane of polarized light. This man was the first to produce sub-freezing temperatures in the laboratory, and he developed the laws of electrolysis. This man developed the idea of &quot;lines of force&quot; to describe electric and magnetic fields. Who is this man? ', '', '', '', '', 'Michael Faraday ', 0, 3, 0, '2013-11-26 02:55:40', 0),
(345, 0, 2, 1, 'The strong form of Planck&#039;s formulation of this statement requires a unity quantum mechanical degeneracy in the ground state. That formulation was based on a consequence of the Nernst-Simon formulation, which and is a generalization of the Nernst Heat Theorem. What is this law? ', '', '', '', '', 'Second Law of Thermodynamics ', 0, 3, 0, '2013-11-26 02:55:40', 0),
